import React, { Component } from 'react';
import ApprovedHead from './denied-details'; 
import '../styles/approved-component/approved.css';

class LoanApproved extends Component {

  render() {
    return (
        <div className='loan-approved'>
        <ApprovedHead 
            thankYouText={'Thank you for the time in checking for yor eligibility for receiving bussiness loan with us'} />
        </div>
    );
  }
}

export default LoanApproved;
